import { Routes } from '@angular/router';
import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { applicationRoute, functionRoute, groupRoute, resourceRoute, roleRoute, userRoute, userPopupRoute, groupPopupRoute } from './';
import { acmReportRoute } from './acm-report/acm-report.route';
import { overviewRoute } from './overview/overview-routing.module';

export const ACM_ROUTES = [
  ...applicationRoute,
  ...functionRoute,
  ...groupRoute,
  ...resourceRoute,
  ...roleRoute,
  ...userPopupRoute,
  ...userRoute,
  ...acmReportRoute,
  ...overviewRoute,
];

export const acmRoutes: Routes = [
  {
    path: '',
    canActivate: [UserRouteAccessService],
    children: ACM_ROUTES,
  },
];
